var exec = require("child_process").exec;
var path = require("path");
var querystring = require("querystring");
var fs = require("fs");
var devicesStatusGenerator = require('./devicesStatusGenerator.js');
var updateConfigGenerator = require('./updateConfigGenerator.js');
var runTestGenerator = require('./runTestGenerator.js');
var getResultsSeriesGenerator = require('./getResultsSeriesGenerator.js');
var saveItemGenerator = require('./saveItemGenerator.js');

function index(response) {
	console.log("Request handler 'index' was called.");

	var filename = path.join(process.cwd(), '/../../../templates/index.jinja2');

	response.writeHead(200, {'Content-Type': 'text/html'});

    var fileStream = fs.createReadStream(filename);
    fileStream.pipe(response);
}

function favicon(response) {
	console.log("Request handler 'static/images/favicon.ico' was called.");

	var filename = path.join(process.cwd(), '/../../images/favicon.ico');

	response.writeHead(200, {'Content-Type': 'image/ico'});

    var fileStream = fs.createReadStream(filename);
    fileStream.pipe(response);
}

function start(response) {
	console.log("Request handler 'start' was called.");
	exec("cat start.html", function (error, stdout, stderr) {
		response.writeHead(200, {'Content-Type': 'text/html'});
		response.write(stdout);
		response.end();
	});

}

function upload(response) {
	console.log("Request handler 'upload' was called.");
	response.writeHead(200, {'Content-Type': 'text/html'});
	response.write("Ok");
	response.end();
}

function responseOk(response) {
	console.log("Serving 'OK' for generic script.");
	response.writeHead(200, {'Content-Type': 'text/html'});
	response.end();
}

function saveItem(response, queryString, postData, pathname) {
	console.log('Request handler \'' + pathname + '\' was called.');
	response.writeHead(200, {'Content-Type': 'application/json'});
	
	var data = JSON.parse(postData);

	response.write(saveItemGenerator.generateSaveItemResponse(data, pathname));
	response.end();
}

