function getReport(response, queryString, postData) {
	console.log("Serving 'OK' for get-report.");
	response.writeHead(200, {'Content-Type': 'text/html'});

	var filename = path.join(process.cwd(), '/../../get-report.html');

    var fileStream = fs.createReadStream(filename);
    fileStream.pipe(response);
}

function getReportData(response, queryString, postData) {
	var report, nameFunction;

	console.log("Serving 'OK' for get-report-data.");
	response.writeHead(200, {'Content-Type': 'application/json'});

	nameFunction = function () {
    	return this.firstName + " " + this.lastName;
	};

	report = {
		  'beatles': [
		    	{ firstName: 'John', lastName: 'Lennon' },
				{ firstName: 'Paul', lastName: 'McCartney' },
				{ firstName: 'George', lastName: 'Harrison' },
				{ firstName: 'Ringo', lastName: 'Starr' }

		  ],
		  'name': nameFunction.toString()
		};

	response.write(JSON.stringify(report));
	response.end();
	// var filename = path.join(process.cwd(), '/../get_results.json');

 //    var fileStream = fs.createReadStream(filename);
 //    fileStream.pipe(response);
}

